import React from 'react'

function InformationDetail() {
    return (
        <div className="p-lg-5" style={{ backgroundColor: '#F5F5F5' }}>
            <h2 className="text-danger" >Thông tin chính về trường mầm non DHT</h2>
            <hr width="100%" align="center" />
        </div>
    )
}

export default InformationDetail
